import React from 'react';
import { Link } from 'react-router-dom';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import * as ROUTES from '../../constants/routes';
import 'typeface-roboto';

const useStyles = makeStyles({
  root: {
    width: '100%',
    maxWidth: 500,
    fontSize: 32
  },
});
export default function Navigation() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <ul>
        <li>
          <Link to={ROUTES.SIGN_IN}><Typography color="textPrimary">
            Sign in :)
          </Typography></Link>
        </li>
        <li>
          <Link to={ROUTES.LANDING}><Typography color="textPrimary">
            Landing
          </Typography></Link>
        </li>
        <li>
          <Link to={ROUTES.HOME}><Typography color="textPrimary">
            Home
          </Typography></Link>
        </li>
        <li>
          <Link to={ROUTES.ACCOUNT}><Typography color="textPrimary">
            Account
          </Typography></Link>
        </li>
        <li>
          <Link to={ROUTES.ADMIN}><Typography color="textPrimary">
            Admin
          </Typography></Link>
        </li>
      </ul>
    </div>
  )
}
